import React, { Component } from 'react';
import { Field } from 'redux-form';


class Login extends Component() {
    render() {
        const {
            handleSubmit,
            // login: {
            //     requesting,
            //     successful,
            //     messages,
            //     errors,
            // },
        } = this.props;

        return (
            <div className="login">
                <form onSubmit={handleSubmit(this.submit)}>
                    <h1>Login</h1>
                    <label htmlFor = "email">Email</label>
                    <Field
                        name="email"
                        type="text"
                        id="email"
                        className="email"
                        label="Email"
                        component="input"
                    />
                    <label htmlFor = "password">Password</label>
                    <Field
                        name="password"
                        type="text"
                        id="password"
                        className="password"
                        label="Password"
                        component="input"
                    />
                    <button action = "submit">LOGIN</button>
    
                </form>
            </div>
        )
    }
    
}

export default Login;
